import { useEffect, useState } from "react";
import api from "../services/api";

export default function Clientes() {
  const [clientes, setClientes] = useState([]);

  useEffect(() => {
    api.get("/clientes").then((res) => {
      setClientes(res.data);
    });
  }, []);

  return (
    <div>
      <h1>Clientes</h1>

      <ul>
        {clientes.map((c) => (
          <li key={c.id}>{c.nome}</li>
        ))}
      </ul>
    </div>
  );
}
